import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for products to load and click first "Add to Cart" button
    await page.waitForSelector('.product-card', { timeout: 5000 });
    await page.click('.product-card:first-child .add-to-cart');

    // Wait for cart count to update
    await page.waitForFunction(() => {
      const cartCount = document.querySelector('.cart-count');
      return cartCount && cartCount.textContent !== '0';
    }, { timeout: 5000 });

    // Take screenshot after adding to cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_added_to_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_added_to_cart.png'));

    // Extract product details and cart count
    const extractedData = {
      productTitle: await page.$eval('.product-card:first-child .product-title', el => el.textContent.trim()),
      productPrice: await page.$eval('.product-card:first-child .product-price', el => el.textContent.trim()),
      cartCount: await page.$eval('.cart-count', el => el.textContent.trim())
    };

    return {
      success: true,
      action: "Added first product to cart successfully",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add first product to cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
